  false,\n\t\"url\": null,\n\t\"notes\": \"<ol start=\"2009\">n<li>Centers for Disease
  Control and Prevention (CDC). PRAMS, the Pregnancy Risk Assessment Monitoring System,
  is a surveillance system collecting state-specific, population-based data on maternal
  attitudes and experiences before, during, and shortly after pregnancy. It is a collaborative
  project of the Centers for Disease Control and Prevention (CDC) and state health
  departments. PRAMS provides data for state health officials to use to improve the
  health of mothers and infants. PRAMS topics include abuse, alcohol use, contraception,
  breastfeeding, mental health, morbidity, obesity, preconception health, pregnancy
  history, prenatal-care, sleep behavior, smoke exposure, stress, tobacco use, WIC,
  Medicaid, infant health, and unintended pregnancy. Data will be updated annually
  as it becomes available.</li>n</ol>n\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
